import React from 'react';

import DashboardMenu from '../components/DashboardMenu';

const Dashboard = () =>{
    return <>
        <div className="row">
            <div className="col-md-3">
                <DashboardMenu/>
            </div>
        </div>

    </>
}

export default Dashboard
